import React from 'react';
import PropTypes from 'prop-types';
import {
  Message,
  Container,
  Header,
  Rating,
  Image,
  Grid,
} from 'semantic-ui-react';

const Reviews = ({ reviews }) => {
  return (
    <Grid.Row>
      {reviews &&
        reviews.map((review) => (
          <Message key={review.author_name}>
            <Container >
              <Header>
                <Image  size='massive' src={review.profile_photo_url} />
                <a href={review.author_url} rel='no referrer'>
                  <>{review.author_name}</>
                </a>
              </Header>

              <Rating
                disabled
                icon='star'
                maxRating={5}
                rating={review.rating}
              />
            </Container>

            <Message.Content>{review.text}</Message.Content>
          </Message>
        ))}
    </Grid.Row>
  );
};

Reviews.propTypes = {
  reviews: PropTypes.array.isRequired,
};

export default Reviews;
